import { Tabs, Tab, Toolbar, Typography, Button } from '@mui/material';
import AppBar from '@mui/material/AppBar';
import './aaa.css';
import { makeStyles } from "@mui/material";


const useStyles = makeStyles({
    buttom:{
        color:"#fff",
        fontSize:'50px',
        backgroundColor: "blue"
    }
})
export const Navbar = () => {

 const classes = useStyles()
    return (
        <>
            <AppBar elevation={0} style={{ background: 'radial-gradient(circle at 3% 25%, rgba(0, 40, 83, 1) 0%, rgba(4, 12, 24, 1) 25%)' }}>
                <Toolbar disableGutters sx={{ p: 3, ml: 5 }} >
                    <Tabs textColor="primary" >
                        <Tab >
                            <Typography>
                                Logo
                            </Typography>
                        </Tab>
                        <Tab label='HOME' disableRipple/>
                        <Tab label='What is GPT?'disableRipple />
                        <Tab label='OPEN AI' />
                        <Tab label='CASE STUDIES'disableRipple />
                        <Tab label='Library'disableRipple />

                    </Tabs>
                    <Button 
                    size={'large'}
                    sx={{marginLeft:'auto',marginRight:'20px'}}
                    color='success'
                    disableElevation
                    variant='outlined'>
                        Sign In
                    </Button>
                    <Button
                    
                     size={'large'}
                    sx={{marginRight:'50px'}}
                    color='primary'
                    disableElevation
                    variant='contained'>
                        Sign Up
                    </Button>


                </Toolbar>

            </AppBar>
        </>
    )
}
